import React from 'react';

function Header({ isLoggedIn, onLogin, onLogout }) {
  return (
    <header>
      <h1>Вітаю вас на своєму сайті!</h1>
      {isLoggedIn ? (
        <button onClick={onLogout}>Вийти</button>
      ) : (
        <button onClick={onLogin}>Увійти</button>
      )}
    </header>
  );
}

export default Header;
